/**
 * Checks if an iterable is empty.
 *
 * @param {Iterable<any>} iterable - The iterable to check.
 * @returns {boolean} True if the iterable is empty, otherwise false.
 * @throws {TypeError} If the argument is not an iterable.
 */
declare function isIterableEmpty(iterable: Iterable<any>): boolean;

export = isIterableEmpty;
